import { Routes, Route } from "react-router-dom";

//Import Routes
const routes = require('./routes.json');

import { HomePage, ContentsPage } from "../views/index";

const RoutesPag = () => {
    
    return (
        <Routes>
            {/* Home */}
            <Route path={routes.Routes.Home} element={<HomePage />} />;
            
            
            {/* ======================= Contents ========================== */}
            
            <Route 
                path={routes.Routes.Contents.Home} 
                element={<ContentsPage path={routes.Routes.Contents.Home} />} />

            
            {/* *********************** Computing ************************* */}
            
            <Route
                path={routes.Routes.Contents.Computing}
                element={<ContentsPage path={routes.Routes.Contents.Computing} />}
                />
            
            {/* *********************** Programming ************************* */}
            
            {/* ======================= Contents ========================== */}
            
            
            <Route
                path="*"
                element={<h1>ERROR 404 No se encuentra el documento</h1>}
            />
        </Routes>
    );
};

export { RoutesPag as PagApp };
